import React from "react";
import ReactDOM from "react-dom";
import Heading from "./Heading";
import Para from '/.Para';

ReactDOM.render(
    <>
        <Heading />
        <Para/>
        <p>This is paragraph</p>
        <ol>
            <li> Khushbu </li>
            <li> Chetna </li>
            <li> Ritu </li>
            <li> Ahinsa </li>
            <li> Kajal</li>
        </ol>
    </>,
    document.getElementById("root")
);
